import React from 'react';
import { HaidilaoLogoMini } from '../../asset/images/restaurant_info/haidilao/index.js';
import { StarIcon, TimeIcon } from '../../asset/icons/box/index.js';

const Information = ({ caseValue }) => {
  let content;

  switch (caseValue) {
    case 'A':
      content = 'Table No.15';
      break;
    case 'B':
      content = 'L3 Vincom Center, 72 Lê Thánh Tôn, P. Bến Nghé, Quận 1, TP. HCM.';
      break;
    default:
      content = '';
  }

  return (
    <div className="w-299 h-120 border border-gray-500 rounded-lg flex flex-col justify-center items-center">
      {/* Top section */}
      <div className="flex items-center p-2">
        <HaidilaoLogoMini className="w-25 h-25 rounded-full" />
        <h1 className="ml-2">Haidilao - Dong Khoi</h1>
      </div>
      {/* Section divider */}
      <hr className="border border-gray-500 w-4/5 h-px" />
      {/* Bottom section */}
      <div className="p-2 text-center">
        <p className="mb-2">{content}</p>
      </div>
      {/* Common elements for both cases */}
      <div className="flex items-center p-2">
        <StarIcon className="w-5 h-5" />
        <p className="ml-1">4.9 (284)</p>
        <TimeIcon className="w-5 h-5 ml-4" />
        <p className="ml-1">15-25 mins</p>
      </div>
    </div>
  );
};

export default Information;
